      <div itemID="fountainG_2" className={classes.fountainG} />
      <div itemID="fountainG_3" className={classes.fountainG} />
      <div itemID="fountainG_4" className={classes.fountainG} />
      <div itemID="fountainG_5" className={classes.fountainG} />
      <div itemID="fountainG_6" className={classes.fountainG} />
      <div itemID="fountainG_7" className={classes.fountainG} />
      <div itemID="fountainG_8" className={classes.fountainG} />
    </div>
  );
};

export default Loader;
